import React from 'react'

const CustomTableThead = (props) => {
  return (
    <React.Fragment>
      <thead>
          <tr>
            {Object.keys(props.thradData[0]).map((key) => (
              <th key={key}>{key}</th>
            ))}
          </tr>
        </thead>
    </React.Fragment>
  )
}

export default CustomTableThead
